import React from 'react';
import Navbar from '../components/common/navbar';
import Section from '../components/board/section';
import Footer from '../components/common/footer';

const Board = () => {
  return (
    <>
      <Navbar />
      <Section />
      <Footer />
    </>
  )
};

export default Board;
